	"shapein/UsersMonitoring/view/ViewSettingsDialog.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core" xmlns:l="sap.ui.layout"><ViewSettingsDialog id="viewSettingsDialog" confirm=".onConfirmViewSettingsDialog" cancel="handleCancel" sortDescending="true"\n\t\tresetFilters=".handleResetFilters"><sortItems><ViewSettingsItem text="{i18n>masterSort1}" key="status_code" selected="false"/><ViewSettingsItem text="{i18n>masterSort2}" key="timestamp_start" selected="true"/><ViewSettingsItem text="{i18n>masterSort3}" key="numberOfItems" selected="false"/><ViewSettingsItem text="{i18n>masterSort4}" key="numberOfSeconds" selected="false"/></sortItems><filterItems><ViewSettingsCustomItem id="idCustomFilterItem" text="Run Dates" key="timestamp_start"><customControl><l:VerticalLayout class="sapUiContentPadding" width="100%"><Label text="FROM"/><DateTimePicker id="DTP1" value="" valueFormat="yyyy-MM-dd-HH-mm-ss" displayFormat="long" change="changeDates"\n\t\t\t\t\t\t\tclass="sapUiSmallMarginBottom"/><Label text="TO"/><DateTimePicker id="DTP2" value="" valueFormat="yyyy-MM-dd-HH-mm-ss" displayFormat="long" change="changeDates"\n\t\t\t\t\t\t\tclass="sapUiSmallMarginBottom"/></l:VerticalLayout></customControl></ViewSettingsCustomItem><ViewSettingsFilterItem text="Status" key="status_code"><items><ViewSettingsItem text="Success" key="S"/><ViewSettingsItem text="Error" key="E"/><ViewSettingsItem text="Warning" key="W"/><ViewSettingsItem text="Running" key="R"/></items></ViewSettingsFilterItem><ViewSettingsCustomItem id="idCustomFilterItem2" text="Number of Users" key="numberOfItems"><customControl><RangeSlider showAdvancedTooltip="true" range="0,0" min="0" max="200" width="100%" showHandleTooltip="false" inputsAsTooltips="true"\n\t\t\t\t\t\tclass="sapUiLargeMarginBottom" change="changeSlider"/></customControl></ViewSettingsCustomItem></filterItems></ViewSettingsDialog></core:FragmentDefinition>',
	"shapein/UsersMonitoring/view/ViewSettingsDialogDetail.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core" xmlns:l="sap.ui.layout"><ViewSettingsDialog id="viewSettingsDialogDetail" confirm=".searchFilters" cancel="handleCancel" sortDescending="true"\n\t\tresetFilters=".handleResetFilters"><sortItems><ViewSettingsItem text="User" key="pernr" selected="true"/><ViewSettingsItem text="First Name" key="firstname" selected="false"/><ViewSettingsItem text="Last Name" key="lastname" selected="false"/></sortItems><filterItems><ViewSettingsCustomItem id="idCustomFilterItem" text="Users" key="pernr"><customControl><l:VerticalLayout class="sapUiContentPadding" width="100%"><Label text="FROM"/><Input id="inputNumber1" type="Number" placeholder="Enter a employee number" class="sapUiSmallMarginBottom"\n\t\t\t\t\t\tchange="changeUsers"/><Label text="TO"/><Input id="inputNumber2" type="Number" placeholder="Enter a employee number" class="sapUiSmallMarginBottom"\n\t\t\t\t\t\tchange="changeUsers"/></l:VerticalLayout></customControl></ViewSettingsCustomItem><ViewSettingsCustomItem id="idCustomFilterItem2" text="Last Name" key="lastname"><customControl><l:VerticalLayout class="sapUiContentPadding" width="100%"><Label text="FROM"/><Input id="input1" type="Text" placeholder="Enter a Last Name" class="sapUiSmallMarginBottom"\n\t\t\t\t\t\tchange="changeLast"/><Label text="TO"/><Input id="input2" type="Text" placeholder="Enter a Last Name" class="sapUiSmallMarginBottom"\n\t\t\t\t\t\tchange="changeLast"/></l:VerticalLayout></customControl></ViewSettingsCustomItem></filterItems></ViewSettingsDialog></core:FragmentDefinition>'
